import React from 'react'
import {AiFillCloud} from 'react-icons/ai'


const SideBar = () => {
  return (
    <div className='W-[100px] h-full bg-blue-500 flex flex-col'>

        <div>
            <AiFillCloud width={500} height={100}/>
        </div>

    </div>
  )
}

export default SideBar
